//The contenteditable and spellcheck attributes allow for rich text editing with real-time spelling error detection directly on a webpage, enhancing user experience and preventing errors.

import React from "react";
import ReactDOM from "react-dom";

const img = "https://picsum.photos/200";

ReactDOM.render(
  <div>
    <h1 className="heading" contenteditable="true" spellcheck="false">
      Random Image
    </h1>
    <img className="random" alt="random" src={img + "?grayscale"} />
    <h2 className="heading" contenteditable="true" spellcheck="false">
      My Favourite Foods
    </h2>
    <img
      className="food-img"
      alt="bhel"
      src="data:image/jpeg;base64,"
    />
    <img
      className="food-img"
      alt="samosa"
      src="data:image/jpeg;base64,"
    />
    <img
      className="food-img"
      alt="noodles"
      src="https://www.errenskitchen.com/wp-content/uploads/2014/04/quick-and-easy-chinese-noodle-soup3-1.jpg"
    />
  </div>,
  document.getElementById("root")
);
